  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112347 includes biological,
  chemical, discrete sample, physical and profile data collected from Hakuho Maru
  in the Indian Ocean, North Pacific Ocean and South Pacific Ocean from 2001-12-08
  to 2002-01-19 and retrieved during cruise CARINA/49HH20011127. These data include
  AMMONIUM, CHLOROPHYLL A, DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC
  PRESSURE, NITRATE, NITRITE, PHOSPHATE, Potential temperature (theta), SALINITY,
  SILICATE and WATER TEMPERATURE. The instruments used to collect these data include
  CTD and bottle. These data were collected by Masao Ishii of Meteorological Research
  Institute; Geochemical Research Department and M. Terazaki of Tokyo University;
  Ocean Research Institute as part of the CARINA_49HH20011127 data set.The CARINA
  (CARbon dioxide IN the Atlantic Ocean) data synthesis project is an international
  collaborative effort of the EU IP CARBOOCEAN, and U.S. partners. It has produced
  a merged internally consistent data set of open ocean subsurface measurements for
  biogeochemical investigations, in particular, studies involving the carbon system.
  The original focus area was the North Atlantic Ocean, but over time the geographic
  extent expanded and CARINA now includes data from the entire Atlantic, the Arctic
  Ocean, and the Southern Ocean.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
